INSERT INTO `tb_postagens` (`id`, `titulo`, `texto`, `imagem`, `data`) VALUES
(19, 'O que é github e para que serve', '<h6 style=\"text-align: justify; \"><span style=\"font-family: Arial; font-size: 18px;\">GitHub é um sistema de gerenciamento de projetos e versões de código-fonte usando o Git. Mas, para que o GitHub é utilizado? Entre outras coisas, ele permite que você armazene os seus projetos em nuvem e trabalhe gerenciando e acompanhando o desenvolvimento. Além de contribuir em projetos específicos, o GitHub permite a socialização com pessoas que possuem os mesmos interesses que você. Você pode seguir pessoas e acompanhar o que fazem ou com quem se comunicam.</span></h6><p style=\"text-align: justify;\"><span style=\"font-family: Arial; font-size: 18px;\"><b>O que é o Git?</b></span></p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 25%;\"><span style=\"font-family: Arial; font-size: 18px;\"><b><br></b></span></p><p style=\"text-align: justify;\"><span style=\"font-family: Arial; font-size: 18px;\">Foi criado em 2005 pelo Linus Torvalds, criador do kernel do Linux, para hospedar o código-fonte do Linux e permitir a colaboração em seu desenvolvimento, já que a antiga empresa que hospedava seu código, a BitKeeper, pretendia cobrar pelos seus serviços.</span></p><p style=\"text-align: justify;\"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Então, foi criado o sistema Git que, por sua vez, ajuda a acompanhar as mudanças feitas no código base. Além disso, ele registra quem efetuou a mudança e permite a restauração do código removido ou modificado caso algo dê errado.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Portanto, se tivermos que resumir, Git nada mais é que um sistema de controle de versão. Já o GitHub, uma rede social para pessoas que possuem um projeto de negócio ou até mesmo pessoal. Abaixo mostraremos conceitos de termos utilizados pela plataforma:</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b>Repositório</b></span></font></p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"repo.PNG\" style=\"width: 50%;\"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b><br></b></span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Repositório ou repo, é um diretório onde os arquivos do seu projeto ficam armazenados. Ele pode ficar em um depósito do GitHub ou em seu computador. Você pode armazenar códigos, imagens, áudios, ou qualquer outra coisa relacionada ao projeto no diretório.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b>Pull Request</b></span></font></p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 25%;\"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b><br></b></span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Imagine a seguinte situação: várias pessoas estão trabalhando num mesmo projeto, editando e melhorando o mesmo código. Se todas fizerem modificações e enviarem simultaneamente para o repositório, pode ficar complicado e virar uma bagunça, não é mesmo? Para resolver essa situação existe o Pull Request.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Quando você o utiliza, está dizendo: aqui está o trabalho que fiz, preciso integrá-lo ao ramo principal. Ao utilizar o Pull Request, gera-se um registro no servidor que destaca as diferenças de código entre o ramo (branch- falaremos sobre isso em breve) no qual você trabalhou e o ramo alvo da entrega. Assim fica fácil para outros desenvolvedores revisarem o seu trabalho. Com ele é possível também discorrer discussões em trechos específicos e propor alterações.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b>Commit</b></span></font></p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 25%;\"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b><br></b></span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">No Git, tudo é movido através de pontos na história do projeto. A esses pontos, damos o nome de commits. Esses são basicamente formados por conjuntos de alterações em um ou mais arquivos, com uma descrição que resume as alterações feitas nesse ponto.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b>Branch</b></span></font></p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 50%;\"><br></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Imagine a seguinte situação: seu site está pronto, mas surge a necessidade de alterar algumas partes dele para melhorá-lo. Além disso, você quer manter essas alterações tanto no seu computador de casa, quanto no computador do trabalho. Se você começa a alterar os arquivos em casa, parar na metade da implementação e precisa terminar no trabalho, como você iria commitar tudo pela metade? seu site ficaria incompleto.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Para isso existe o conceito de branch que é justamente ramificar o seu projeto em dois, como se cada um deles fosse um repositório, e depois juntá-lo novamente utilizando o Merge.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b>Marge</b></span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Podemos resumir marge como união de duas branches. O merge basicamente cria um novo commit na branch em que foi realizado. Esse commit \"especial\" é chamado de merge commit.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b>Fork</b></span></font></p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"fork1.PNG\" style=\"width: 50%;\"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b><br></b></span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Um fork é uma cópia de um repositório permite experimentar mudanças livremente sem afetar o projeto original.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Geralmente, forks são utilizados para propor mudanças no projeto de alguém ou para utilizá-lo como ponto de início de sua própria ideia.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Um grande exemplo usando fork é corrigindo bugs no código de outra pessoa. Ao invés de registrar o problema ou bug encontrado, você pode forkar o repositório, fazer as correções necessárias e enviar um Pull Request para o administrador do projeto.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Se o administrador do projeto gostar do seu trabalho ele pode puxar sua correção para o repositório original.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b>Star</b></span></font></p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"start.PNG\" style=\"width: 50%;\"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\"><b><br></b></span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Você pode marcar repositórios e tópicos com estrelas e assim acompanhar os projetos que você acha interessante ou quiser acompanhar o conteúdo relacionado no seu feed de notícias.</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Marcar os tópicos com estrelas faz com que seja fácil achar novamente o repositório ou tópico que desejar mais tarde. Você pode ver todos os repositórios e tópicos que voc~e marcou indo em stars page. Para obter mais informações sobre como interagir com os repositórios e tópicos que você marcou, consulte \"Gereciando suas estrelas\".</span></font></p><p style=\"text-align: justify; \"><font face=\"muli, sans-serif\"><span style=\"font-size: 18px; font-family: Arial;\">Você também pode marcar os repositórios e tópicos para descobrir projetos similares no Github. Quando você marcar um repositório ou tópico, o GitHub pode recomendar conteúdo relacionado no Discovery News do seu feed de notícias.</span></font></p>', '1438668721post1.png', '2020-10-29');

